import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Header />
      <Technologis />
     </div>
  );
}

const Header = () => {
  return (
    <div className="Header">
      <ul>
        <li>home</li>
        <li>project</li>
        <li>content</li>
      </ul>
     </div>
  );
}

const Technologis = () => {
  return (
    <div className="Technologis">
      <ul>
        <li>css</li>
        <li>jsx</li>
        <li>react.js</li>
      </ul>
     </div>
  );
}

export default App;
